import React, { useState, useEffect } from 'react';
import Nav from '../Navigation/Nav';
// import './ViewResponse.css'; // add a separate CSS file for styling

const ViewResponse = () => {
  const [responseData, setResponseData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:8080/api/v1/response/all');
        const data = await response.json();
        setResponseData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <> <Nav />
    <div className="table-container" style={{ marginTop: "150px" }}>
        <h2>View Resonse</h2>
        <table className="event-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Event</th>
              <th>Feedback</th>
              <th>Event Name</th>
              <th>Event t</th>
            </tr>
          </thead>
          <tbody>
            {responseData.map((event,index) => (
              <tr key={event.ID}>
                <td>{event}</td>
                <td>{event}</td>
                <td>{event}</td>

              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default ViewResponse;
